const AppStyled = styled.div`
  background-color: #000000;
  position: relative;
  display: flex;
  flex-direction: column;
  height:100vh;

  main {
    margin-top: 3rem;
    flex-grow: 1; 
    overflow-y: auto;  
    &::-webkit-scrollbar {
      width: 0;
    }
  }
`;


export default App;
